    (AL, AR, BL, BR) = ([], [], [], [])
    for (sa_i, ea_i, sb_i, eb_i) in lectures:
        AL.append(sa_i)
        AR.append(ea_i)
        BL.append(sb_i)
        BR.append(eb_i)

    def chk(L, R):
        D = {s: i for (i, s) in enumerate(sorted(list(set(L * R))))}
        X = [0] * 200200
        for (i, l) in enumerate(L):
            X[D[l]] += W[i]
        for i in range(1, 200200):
            X[i] += X[i - 1]
        return sum([X[D[r]] * W[i] for (i, r) in enumerate(R)])
    return 'YES' if chk(AL, AR) == chk(BL, BR) else 'NO'
